import React from 'react'
import { useState } from 'react'
const Any = () => {
    const [count,setCount] =useState()

    const increment=()=>{
        setCount(count+1)
    }
    const decrement=()=>{
        setCount(count-1)
    }
  return (
    <>
    <button onClick={increment}>increment</button>
  
    <button onClick={decrement}>Decrement</button>
    </>
  )
}

export default Any
